import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import InputField from "../components/form-elements/InputField";

export default function GeneratePage() {
  const validationSchema = Yup.object({
    prompt: Yup.string().required("Please enter a prompt."),
    negative_prompt: Yup.string().required("Please enter a negative prompt."),
  });

  const initialValues = {
    prompt: "",
    negative_prompt: "",
  };

  const handleSubmit = (values) => {
    console.log("Prompt:", values.prompt);
    console.log("Negative Prompt:", values.negative_prompt);
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-r from-yellow-100 via-pink-100 to-blue-100">
      <Formik
        initialValues={initialValues}
        validationSchema={validationSchema}
        onSubmit={handleSubmit}
      >
        {() => (
          <Form
            className="bg-white p-10 rounded-3xl shadow-lg w-full max-w-lg border-4 border-yellow-400 transform hover:scale-105 transition-transform duration-300 ease-in-out"
            style={{ boxShadow: "10px 10px 0px #ffcb05" }}
          >
            <h2 className="text-3xl font-extrabold mb-6 text-center text-purple-600">
              üñºÔ∏è Text to Image Form üñºÔ∏è
            </h2>

            <div className="mb-6">
              <label
                className="block text-purple-700 text-lg font-bold mb-2"
                htmlFor="prompt"
              >
                ‚ú® Prompt
              </label>
              <InputField
                type="text"
                id="prompt"
                name="prompt"
                color="yellow"
                boxShadowColor="#ffd700"
                placeholder="What's on your mind?"
              />
            </div>

            <div className="mb-6">
              <label
                className="block text-purple-700 text-lg font-bold mb-2"
                htmlFor="negative_prompt"
              >
                üö´ Negative Prompt
              </label>
              <Field
                type="text"
                id="negative_prompt"
                name="negative_prompt"
                className="w-full px-4 py-3 border-2 border-blue-400 bg-blue-50 rounded-xl shadow-lg focus:outline-none focus:ring-4 focus:ring-pink-400"
                placeholder="Anything to avoid?"
                style={{ boxShadow: "5px 5px 0px #00f" }}
              />
              <ErrorMessage
                name="negative_prompt"
                component="div"
                className="text-red-600 text-sm mt-2 italic font-semibold"
              />
            </div>

            {/* Submit Button */}
            <div className="flex items-center justify-center">
              <button
                type="submit"
                className="w-full bg-pink-500 hover:bg-pink-600 text-white font-bold py-3 px-6 rounded-xl transform hover:scale-105 transition-transform duration-300 ease-in-out focus:outline-none focus:ring-4 focus:ring-yellow-300"
                style={{ boxShadow: "8px 8px 0px #ff69b4" }}
              >
                üöÄ Generate Image
              </button>
            </div>
          </Form>
        )}
      </Formik>
    </div>
  );
}
